import Welcome from '../components/Welcome'

const Accueil = () => {
  return (
    <Fragment>
      <div className="accueil">
        {/* remplacer par le prenom user */}
        <Welcome />
      </div>
      <div className="graphiques"></div>
      <div className="energie"></div>
    </Fragment>
  )
}

export default Accueil
